const t=JSON.parse('{"key":"v-3fc9ab58","path":"/code_note/java/01_base/ch3.html","title":"3）方法重载","lang":"zh-CN","frontmatter":{"icon":"markdown","title":"3）方法重载","category":["java"],"tag":["basic"],"description":"方法重载（Overloading）：在同一类内定义的一组或多组同名方法； 同一性：所有参与重载的方法均位于同一个类的内部定义； 名称一致性：这些方法共享相同的方法名称，但参数列表各不相同； 参数差异性； 需要注意的是： 重载的判断基于方法的声明和定义，与方法的实际调用方式无直接关联；无论调用时使用何种形式，编译器会根据传入参数自动匹配到对应的方法实现； 方法的返回类型并不作为判定重载的依据，即使两个方法的返回类型不同，但如果它们的参数列表相同，则不会构成重载；","head":[["meta",{"property":"og:url","content":"https://ajplus.cn/code_note/java/01_base/ch3.html"}],["meta",{"property":"og:title","content":"3）方法重载"}],["meta",{"property":"og:description","content":"方法重载（Overloading）：在同一类内定义的一组或多组同名方法； 同一性：所有参与重载的方法均位于同一个类的内部定义； 名称一致性：这些方法共享相同的方法名称，但参数列表各不相同； 参数差异性； 需要注意的是： 重载的判断基于方法的声明和定义，与方法的实际调用方式无直接关联；无论调用时使用何种形式，编译器会根据传入参数自动匹配到对应的方法实现； 方法的返回类型并不作为判定重载的依据，即使两个方法的返回类型不同，但如果它们的参数列表相同，则不会构成重载；"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:author","content":"ajplus"}],["meta",{"property":"article:tag","content":"basic"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"3）方法重载\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"ajplus\\",\\"url\\":\\"https://github.com/ajplus-zz/\\",\\"email\\":\\"ajplusdd@gmail.com\\"}]}"]]},"headers":[],"git":{},"readingTime":{"minutes":0.7,"words":209},"filePathRelative":"code_note/java/01_base/ch3.md","excerpt":"<p>方法重载（<code>Overloading</code>）：在同一类内定义的一组或多组同名方法；</p>\\n<ul>\\n<li>同一性：所有参与重载的方法均位于同一个类的内部定义；</li>\\n<li>名称一致性：这些方法共享相同的方法名称，但参数列表各不相同；</li>\\n<li>参数差异性；</li>\\n</ul>\\n<p>需要注意的是：</p>\\n<ul>\\n<li>重载的判断基于方法的声明和定义，与方法的实际调用方式无直接关联；无论调用时使用何种形式，编译器会根据传入参数自动匹配到对应的方法实现；</li>\\n<li>方法的返回类型并不作为判定重载的依据，即使两个方法的返回类型不同，但如果它们的参数列表相同，则不会构成重载；</li>\\n</ul>","autoDesc":true}');export{t as data};
